import React from "react";
import {
  Dropdown,
  Table,
  Form,
  Button,
  Spinner,
  Row,
  Col,
  Alert,
} from "react-bootstrap";
import style from "./chart.css";
import { Line } from "react-chartjs-2";
import Routes from "./routes";

const lineColors = [
  "rgb(237, 41, 58)",
  "rgb(75,192,192)",
  "rgb(230,54,192)",
  "rgb(100, 53, 201)",
  "rgb(33, 133, 208)",
];

const options = {
  responsive: true,
  scales: {
    xAxes: [
      {
        display: true,
        scaleLabel: {
          display: true,
          labelString: "Dates",
        },
      },
    ],
    yAxes: [
      {
        display: true,
        scaleLabel: {
          display: true,
          labelString: "# of Requests",
        },
      },
    ],
  },
};

class StatsChart extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      lineData: {},
    };
  }

  render() {
    return (
      <div className={style.chartContainer}>
        <h2 className={style.title}>Traffic Analysis Chart</h2>
      </div>
    );
  }
}

class StatsChartOptionsBar extends React.Component {
  render() {
    return <div className={style.optionContainer}></div>;
  }
}

export default StatsChart;
